import React from 'react';
import { Layout, Menu, Icon, Contnet,  Form,  Input, Button, Checkbox } from 'antd';
import Defaultlayout from '../defaultLayout/defaultLayout'

const FormItem = Form.Item;

const { Header, Content, Sider } = Layout;


class Forms extends React.Component {
    render(){
        const formItemLayout = {
            labelCol: {
              xs: { span: 24 },
              sm: { span: 8 },
            },
            wrapperCol: {
              xs: { span: 24 },
              sm: { span: 16 },
            },
          };
          const tailFormItemLayout = {
            wrapperCol: {
              xs: {
                span: 24,
                offset: 0,
              },
              sm: {
                span: 16,
                offset: 8,
              },
            },
          };
        return(

           <Defaultlayout  style={{ margin: '24px 16px', padding: 24, background: '#fff', minHeight: 280 }}>

               <Form onSubmit={this.handleSubmit} className="form" style={{display:'flex'}}>
        <FormItem  label="Name"  {...formItemLayout}>

            <Input prefix={<Icon type="user" style={{ color: 'rgba(0,0,0,.25)' }} />} placeholder="Name" />
        </FormItem>

        <FormItem label="Email"  {...tailFormItemLayout}>

            <Input prefix={<Icon type="email" style={{ color: 'rgba(0,0,0,.25)' }} />} type="password" placeholder="Email" />

        </FormItem>
        <FormItem>


           <Button type="primary" htmlType="submit" className="login-form-button">
            Submit
          </Button>

        </FormItem>
      </Form>
           </Defaultlayout>
        );
    }
}

export default Forms;
